import React from "react";

const styles = {
  container: {
    marginLeft: "30px",
    marginTop: "30px",
  },
  p: {
    display: "block",
    marginBottom: "10px",
    color: "black",
    fontSize: "20px",
  },
};

function Resume() {
  return (
    <div className="right">
      <div style={styles.container}>
        <p style={styles.p}>COMING SOON</p>
      </div>
    </div>
  );
}

export default Resume;
